tables.table_schema:
CREATE TABLE quantum_algorithm_performance_metrics (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    execution_time FLOAT,
    success_rate FLOAT
);

CREATE TABLE QuantumAlgorithmPerformanceMetrics (
    algorithm_id INT PRIMARY KEY,
    algorithm_name TEXT,
    execution_time FLOAT,
    success_rate FLOAT
);

CREATE TABLE QuantumAlgorithmUsers (
    user_id INT PRIMARY KEY,
    user_name TEXT,
    user_email TEXT,
    algorithm_id INT REFERENCES QuantumAlgorithmPerformanceMetrics(algorithm_id)
);

CREATE TABLE Quantum_Algorithms (
    algorithm_id UUID PRIMARY KEY,
    algorithm_name VARCHAR(255) NOT NULL,
    execution_time DECIMAL NOT NULL,
    success_rate FLOAT NOT NULL
);

CREATE TABLE Execution_Log (
    log_id UUID PRIMARY KEY,
    algorithm_id UUID NOT NULL,
    execution_date TIMESTAMP NOT NULL,
    execution_status VARCHAR(50) NOT NULL
);

CREATE TABLE Algorithm_Tags (
    tag_id UUID PRIMARY KEY,
    tag_name VARCHAR(50) NOT NULL,
    algorithm_id UUID NOT NULL
);

CREATE TABLE quantum_algorithm_performance_metrics (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    execution_time FLOAT,
    success_rate DECIMAL(5,2)
);

CREATE TABLE algorithm_results (
    result_id INT PRIMARY KEY,
    run_id INT,
    result_value VARCHAR(255),
    FOREIGN KEY (run_id) REFERENCES algorithm_runs(run_id)
);

CREATE TABLE algorithm_errors (
    error_id INT PRIMARY KEY,
    run_id INT,
    error_message TEXT,
    FOREIGN KEY (run_id) REFERENCES algorithm_runs(run_id)
);

CREATE TABLE QuantumAlgorithmMetrics (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    execution_time_ms INT,
    qubit_count INT
);

CREATE TABLE AlgorithmAuthors (
    author_id INT PRIMARY KEY,
    author_name VARCHAR(255),
    email VARCHAR(255)
);

CREATE TABLE AlgorithmTags (
    tag_id INT PRIMARY KEY,
    tag_name VARCHAR(50)
);
